import React from 'react'

const AddProd = () => {
  return (
    <div>
      <input
        type="text"
        placeholder="Search..."
      />
      <button
      style={{
        height:'45px',
        marginLeft:'10px'
      }}
      >
        confirm
      </button>
    </div>
  )
}

export default AddProd
